import React, { Component } from 'react';
import './Vote'

const language_list = ["JavaScript", "Python", "Go", "Java", "TypeScript", "Ruby", "Elixir"];

class Voting extends Component {

	state = { count: 0, name: "undefinded" }

	constructor(props) {
		super(props);
		this.state.count = 0;
		this.state.name = props.name;
	}

	incrementCount = () => {
		this.setState({ count: this.state.count + 1 })
	}

	render() {
		return (
			<div> Vote for a language
				{ language_list.map(language => (<Vote name={language} />))}
			</div>

		);
	}
}

export default Voting;
